column8:
　コンセプトワン622 4段三脚<br />ベーシックな3ウェイタイプの4段三脚。ドイツ・クールマン社によるスリムなデザインのアルミ三脚。日本以上に寒冷地が多いヨーロッパのフィールドを前提とした基本仕様。操作部のネジ・つまみ・ハンドル等は、操作の妨げになりにくいようできる限り大型化。雲台は日本市場で好まれる3WAYタイプ。クイックシューは機材間の相互使用に優れるアルカスイス互換タイプ。中級一眼レフで使いやすいサイズ感です。<br />●4段式<br />
●アルカスイス互換プレート仕様<br />
●伸長(約) : 155cm(エレベーター使用時)/129cm(脚部のみ)<br />
●最低高 : 22cm<br />
●縮長 : 42cm<br />
●製品重量(約) : 1,510g<br />
●主要材質 : アルミ製　<br />
●パッケージサイズ(mm):130×130×600<br />
●原産国:中国<br />
●重量(パッケージ含む)(g):2135<style type="text/css">





